column8:
　塗装用　切文字マスキングシートになります。<br>
<br>
使いやすい塩ビ製。<br>
<br>
有機溶剤でも使用できるマスキングフィルムです。<br>
<br>
サンドブラストでも使用できます。<br>
<br>
自動車ボディなど塗装鉄板用に！優れた柔軟性を持ち曲面にもフィットします。<br>
<br>
焼付け塗装でもきれいにはがせます。<style type="text/css">
